// src/components/MuscleMap/MuscleFront.js
import React from 'react';

const MuscleFront = ({ selected, onSelect }) => {
  return (
    <g id="Anterior_View_Muscles" data-name="Anterior View Muscles">
      <g id="Quads">
        <path
          d="M151.01,315.88c-6.67-4.85-9.59-16.75-18.25-18.34..."
          className={`quads ${selected === 'quads-left' ? 'active' : ''}`}
          onClick={() => onSelect('quads-left')}
        >
          <title>Quadriceps gauche</title>
        </path>
        <path
          d="M228.64,315.88c6.67-4.85-..."
          className={`quads ${selected === 'quads-right' ? 'active' : ''}`}
          onClick={() => onSelect('quads-right')}
        >
          <title>Quadriceps droit</title>
        </path>
      </g>

      <g id="Abs">
        <path
          d="M178.15,139.45c-26.37.11..."
          className={`abs ${selected === 'abs-left' ? 'active' : ''}`}
          onClick={() => onSelect('abs-left')}
        >
          <title>Abdominaux gauche</title>
        </path>
        <path
          d="M201.32,139.46c-5.16-..."
          className={`abs ${selected === 'abs-right' ? 'active' : ''}`}
          onClick={() => onSelect('abs-right')}
        >
          <title>Abdominaux droit</title>
        </path>
      </g>

      <g id="Pecs">
        <path
          d="M181.25,129.07c10.27-9.18..."
          className={`pecs ${selected === 'pecs-left' ? 'active' : ''}`}
          onClick={() => onSelect('pecs-left')}
        >
          <title>Pectoraux gauche</title>
        </path>
        <path
          d="M239.07,84.52c-8.78-..."
          className={`pecs ${selected === 'pecs-right' ? 'active' : ''}`}
          onClick={() => onSelect('pecs-right')}
        >
          <title>Pectoraux droit</title>
        </path>
      </g>

      <g id="Biceps">
        <path
          d="M93.42,134.04c-19.88..."
          className={`biceps ${selected === 'biceps-left' ? 'active' : ''}`}
          onClick={() => onSelect('biceps-left')}
        >
          <title>Biceps gauche</title>
        </path>
        <path
          d="M290.1,176.9c12.78..."
          className={`biceps ${selected === 'biceps-right' ? 'active' : ''}`}
          onClick={() => onSelect('biceps-right')}
        >
          <title>Biceps droit</title>
        </path>
      </g>

      <g id="Obliques">
        <path
          d="M154.34,195.68c3.35-14.26..."
          className={`obliques ${selected === 'obliques-left' ? 'active' : ''}`}
          onClick={() => onSelect('obliques-left')}
        >
          <title>Obliques gauche</title>
        </path>
        <path
          d="M225.31,195.68c-3.35-..."
          className={`obliques ${selected === 'obliques-right' ? 'active' : ''}`}
          onClick={() => onSelect('obliques-right')}
        >
          <title>Obliques droit</title>
        </path>
      </g>

      {/* Ajoute d'autres groupes musculaires ici (forearms, calves, etc.) */}
    </g>
  );
};

export default MuscleFront;
